import React from 'react';
import { useNavigate } from 'react-router-dom';

const Categories = () => {
  const navigate = useNavigate();

  const categories = [
    {
      name: 'Все',
      path: '/', // Путь для категории
    },
    {
      name: 'Легковые авто',
      path: '/brand/cars', // Пример пути для легковых авто
    },
    {
      name: 'Мототехника',
      path: '/brand/motorcycles', // Пример пути для мототехники
    },
    {
      name: 'Грузовики',
      path: '/brand/trucks', // Пример пути для грузовиков
    },
  ];

  const handleCategoryClick = (path) => {
    navigate(path); // Переход по маршруту
  };

  return (
    <div className="categories">
      {categories.map((el, index) => (
        <div
          key={index}
          onClick={() => handleCategoryClick(el.path)}
          className="category-item"
        >
          {el.name}
        </div>
      ))}
    </div>
  );
};

export default Categories;
